import React from "react";

const Footer = () => {
  return (
    <footer className="footer border z-10 border-t-[#33353F] bg-gray-200 text-black">
    <div className="container p-12 flex justify-between">

      <span>PORTFOLIO</span>
      <p className="text-slate-600">Thank you!</p>
    </div>
  </footer>
  );
};

export default Footer;
